class Solution:
    def maxVowels_(self, s: str, k: int) -> int:
        vowel_dict = {'a':True, 'i':True, 'u':True, 'e':True, 'o':True}
        max_v_count = 0
        n_count = 0
        for i in range(len(s) - k + 1):
            v_count = 0
            sub_str = s[i:i + k]
            for s_ in sub_str:
                if s_ in vowel_dict:
                    v_count += 1
            n_count = len(s) - v_count
            i = max(n_count, i)
            if max_v_count < v_count:
                max_v_count = v_count
        return max_v_count

    def maxVowels(self, s: str, k: int) -> int:
        vowels = set('aeiou')
        count = sum(1 for c in s[:k] if c in vowels)
        max_count = count
        for i in range(k, len(s)):
            if s[i] in vowels:
                count += 1
            if s[i - k] in vowels:
                count -= 1
            if count > max_count:
                max_count = count
        return max_count


sol = Solution()
print(f'{sol.maxVowels("abciiidef", 3)} expect 3')
print(f'{sol.maxVowels("aeiou", 2)} expect 2')
